import React from 'react'
import './Menu.css'
import { menu_list } from '../assets/assets'
import AOS from 'aos';
import 'aos/dist/aos.css';
import { useEffect } from 'react';

const Menu = ({category,setCategory}) => {
 
  useEffect(() => {
     setTimeout(() => {
      AOS.init({ duration: 1000 });
  }, []);
    }, 1000);
    
function loa(){
  alert("kis")
}

  return (
    
        <div className='menu'>
      
      

          <h1>Explore our menu</h1>
          
          <p> Choose from a diverse menu featuring a delectable array of dishes. Our mission is to satisfy your cravings and elevate your dining experience, one delicious meal of a firme</p>
         
          <div className='menu1'>
          
            {menu_list.map((item, index) => {
              return (
                <div data-aos="fade-left">
                      <div key={index} className='menu2'  onClick={() =>setCategory(prev=>prev===item.menu_name?"All":item.menu_name)} >
                  <img  onClick={loa} className={category===item.menu_name?"active":""}src={item.menu_image} />
                  <h5>{item.menu_name}</h5>
                </div>
                </div>
            
              )
            })}
          </div>
       
        </div>


      )
}

      export default Menu
